window.bookSummaryJSON = "<p>Nick Fisher is State's most eligible bachelor - confident, creative, and driven - and is completely aware that every girl he knows is trying to land him. But Nick is more than the marketing genius everyone sees on the outside. In fact, his life is far more complicated than anyone suspects...even his own brothers. </p> <p>Jess Michaelson knows she shouldn't want Nick like all the other girls do, but she's crazy about him anyway. How could anyone resist those charms? When he focuses his attention on her, she has no idea what she's truly in for. </p> <p>Sometimes love is hard. </p> <p>But it's worth the fight. </p>"; 
